import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/home/Home';
import ContactUs from './pages/contact/Contact';
import QrScan from './pages/qrreader/QrScan'; // Update the import
import Signup from './pages/user/Signup';
import Login from './pages/user/Login';
import DataContent from './pages/dynamic/DataContent'; // Update the import
import Admin from './pages/admin/Admin';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/home" element={<Home />} />
        <Route path="/contactUs" element={<ContactUs />} />
        <Route path="/qrReader" element={<QrScan />} /> {/* Update the component name */}
        <Route path="/signup" element={<Signup />} />
        <Route path="/login" element={<Login />} />
        <Route path="/DataContent/:title" element={<DataContent />} /> {/* Update the component name */}
        <Route path="/admin" element={<Admin />} />
      </Routes>
    </Router>
  );
}

export default App;
